import "./Sidebar.css";
import React from "react";
import { Col, Row } from "react-bootstrap";

const Sidebar = ({}) => {
  return (
    <Col className="sidebar">
      <Row><a>Education</a></Row>
      <Row><a>Experience</a></Row>
      <Row><a>Skills</a></Row>
      <Row><a>Achievements</a></Row>
    </Col>
  );
};

export default Sidebar;
